The ContractAbi trait defines the data types that your application uses in a contract. Each type represents a specific part of the contract's behavior: /// A trait that includes all the types exported by a Linera application contract.
pub trait ContractAbi { /// Immutable parameters specific to this application (e.g. the name of a token). type Parameters: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// Initialization argument passed to a new application on the chain that created it /// (e.g. an initial amount of tokens minted). /// /// To share configuration data on every chain, use [`ContractAbi::Parameters`] /// instead. type InitializationArgument: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// The type of operation executed by the application. /// /// Operations are transactions directly added to a block by the creator (and signer) /// of the block. Users typically use operations to start interacting with an /// application on their own chain. type Operation: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// The type of effect executed by the application. /// /// Effects are executed when a message created by the same application is received /// from another chain and accepted in a block. type Effect: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// The argument type when this application is called from another application on the same chain. type ApplicationCall: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// The argument type when a session of this application is called from another /// application on the same chain. /// /// Sessions are temporary objects that may be spawned by an application call. Once /// created, they must be consumed before the current transaction ends. type SessionCall: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// The type for the state of a session. type SessionState: Serialize + DeserializeOwned + Send + Sync + Debug + 'static; /// The response type of an application call. type Response: Serialize + DeserializeOwned + Send + Sync + Debug + 'static;
} All these types must implement the Serialize, DeserializeOwned, Send, Sync, Debug traits, and have a 'static lifetime. In the case of our Counter example, we would like to change our InitializationArgument, Operation to u64, like so: # extern crate linera_base;
# use linera_base::abi::ContractAbi;
# struct CounterAbi;
impl ContractAbi for CounterAbi { type InitializationArgument = u64; type Parameters = (); type Operation = u64; type ApplicationCall = (); type Effect = (); type SessionCall = (); type Response = (); type SessionState = ();
}

