Unit tests run in a constrained environment, so things like access to the key-value store, cross-chain messages and cross-application calls can't be executed. However, they can be simulated using mock APIs. The linera-sdk::test module provides some helper functions to mock the system APIs. Here's an example mocking the key-value store. #[cfg(test)]
mod tests { use crate::state::ApplicationState; use linera_sdk::test::mock_key_value_store; use webassembly_test::webassembly_test; #[webassembly_test] fn test_state_is_not_persisted() { let mut storage = mock_key_value_store(); // Assuming the application uses views let mut application = ApplicationState::load(storage.clone()) .now_or_never() .expect("Mock key-value store returns immediately") .expect("Failed to load view from mock key-value store"); // Assuming `do_something` changes the view, but does not persist it let result = application.do_something(); assert!(result.is_ok()); // Check that the state in memory is different from the state in storage assert_ne!(application, ApplicatonState::load(storage)); }
}

